'use strict';
let AFxmsgReader = require('./AFxmsgReader.js');
let PdasMessageFieldTag = require('./PdasMessageFieldTag.js');
let PdasRequestCommand = require('./PdasRequestCommand.js');
let RemoveOrderMessageBuilder = require('./RemoveOrderMessageBuilder.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
let PdasMessageType = require('./PdasMessageType.js');
let PdasMessageValue = require('./PdasMessageValue.js');
class RemoveOrderFxmsgReader extends AFxmsgReader {
    read(responseList, xmlRootNode, messages) {
        let i;
        if (messages == null || messages.length == 0) {
            return;
        }
        for (i = 0; i <= messages.length - 1; i += 1) {
            if (messages[i].getFieldValue(PdasMessageFieldTag.FXCM_COMMAND_ID) == PdasRequestCommand.REMOVE_ORDER && this.readMessage(responseList, messages[i])) {
                break;
            }
        }
    }
    readMessage(responseList, message) {
        let data, removeOrderMessageBuilder, listInstance;
        removeOrderMessageBuilder = new RemoveOrderMessageBuilder();
        if (message.getType() == PdasMessageType.FXCM_RESPONSE) {
            listInstance = message.getList(PdasMessageFieldTag.FXCM_NO_PARAM);
            if (listInstance != null) {
                data = listInstance.getGroupParamValueByParamName("DAS");
                if (data != null && stdlib.indexOf(data, "0", false) == 0) {
                    responseList.add(this.createLockedMessage(removeOrderMessageBuilder.build()));
                    return true;
                }
            }
        } else if (message.getType() == PdasMessageType.FXCM_REJECT) {
            data = message.getFieldValue(PdasMessageFieldTag.FXCM_ERROR_DETAILS);
            if (data == null) {
                data = message.getFieldValue(PdasMessageFieldTag.FLD_TEXT);
            }
            if (data != null) {
                removeOrderMessageBuilder.setError(data);
                listInstance = message.getList(PdasMessageFieldTag.FXCM_NO_PARAM);
                if (listInstance != null) {
                    removeOrderMessageBuilder.setRequestTxt(listInstance.getGroupParamValueByParamName(PdasMessageValue.CLIENT_QTXT));
                    removeOrderMessageBuilder.setOrderId(listInstance.getGroupParamValueByParamName(PdasMessageValue.CLIENT_ORDER_ID));
                }
                responseList.add(this.createLockedMessage(removeOrderMessageBuilder.build()));
                return true;
            }
        }
        return false;
    }
}
module.exports = RemoveOrderFxmsgReader
